import axios from "axios";

export async function fetchCollectionData(): Promise<any> {
  const url = "https://www.rijksmuseum.nl/api/en/collection?key=2esrTh6M&involvedMaker=Rembrandt+van+Rijn";
  const response = await axios.get(url);
  return response.data;
}

export async function fetchCollectionDetailsData(): Promise<any> {
  const url = "https://www.rijksmuseum.nl/api/en/collection/SK-C-5?key=2esrTh6M";
  const response = await axios.get(url);
  return response.data;
}

export async function fetchCollectionImageData(): Promise<any> {
  const url = "https://www.rijksmuseum.nl/api/en/collection/SK-C-5/tiles?key=2esrTh6M";
  const response = await axios.get(url);
  return response.data;
}
